  const haveAccessArr = Object.entries(access).reduce((accessArr, [key, value]) => {
    if(value) {
      accessArr.push(key);
    }
    return accessArr;
  }, [] as string[]);
  const accessMenus = menus.filter((item: MenuDataItem) => {
    if(!_.isUndefined(item?.access) && !haveAccessArr.includes(item?.access)) return;
    return item;
  })
